import React, { Component } from 'react';

class Table extends Component {
  render() {
    return (
<table class="table">
  <thead class="table-dark">
   <tr><th>hola</th></tr>
  </thead>
  <tbody>
   <tr><td>hola</td></tr>
  </tbody>
</table>
     )
  }
}

export default Table;
